INSERT INTO `surname_variants` (`id`, `person_id`, `original_surname`, `variant_1`, `variant_2`, `notes`, `created_at`) VALUES ('1', '5', 'Horvat', 'Horvath', 'Orvat', 'El apellido Horvat se escribio como Horvath en algunos documentos mexicanos debido a la influencia hungara. Tambien aparece como Orvat en algunos registros civiles.', '2025-12-11 10:19:16');
INSERT INTO `surname_variants` (`id`, `person_id`, `original_surname`, `variant_1`, `variant_2`, `notes`, `created_at`) VALUES ('2', '4', 'Babic', 'Babich', NULL, 'El apellido Babic frecuentemente se hispanizo como Babich en Mexico.', '2025-12-11 10:19:16');
INSERT INTO `surname_variants` (`id`, `person_id`, `original_surname`, `variant_1`, `variant_2`, `notes`, `created_at`) VALUES ('3', '1', 'Kovacevic', 'Kovachevich', 'Kovacevich', 'El apellido Kovacevic (que significa \`hijo del herrero\`) tiene multiples variantes debido a la transliteracion del alfabeto original.', '2025-12-11 10:19:16');
INSERT INTO `messages` (`id`, `sender_id`, `recipient_id`, `type`, `subject`, `body`, `related_person_id`, `action_required`, `action_status`, `action_taken_at`, `read_at`, `deleted_at`, `created_at`) VALUES ('1', NULL, '2', 'system', 'Bienvenido a Mi Familia', 'Bienvenido a Mi Familia, la plataforma genealogica para construir tu arbol genealogico, conectar con familiares y descubrir tus raices. Si tienes alguna pregunta, no dudes en contactarnos.', NULL, '0', NULL, NULL, '2025-12-01 10:19:16', NULL, '2025-12-11 10:19:16');
INSERT INTO `messages` (`id`, `sender_id`, `recipient_id`, `type`, `subject`, `body`, `related_person_id`, `action_required`, `action_status`, `action_taken_at`, `read_at`, `deleted_at`, `created_at`) VALUES ('2', NULL, '2', 'consent_request', 'Solicitud de consentimiento pendiente', 'Has registrado a Ana Babic en tu arbol genealogico. Como es una persona viva mayor de edad con correo electronico registrado, se le ha enviado una solicitud de consentimiento. Tienes 7 dias para que responda antes de que su informacion se oculte automaticamente.', '4', '1', 'pending', NULL, '2025-12-12 10:48:13', NULL, '2025-12-11 10:19:16');
INSERT INTO `messages` (`id`, `sender_id`, `recipient_id`, `type`, `subject`, `body`, `related_person_id`, `action_required`, `action_status`, `action_taken_at`, `read_at`, `deleted_at`, `created_at`) VALUES ('3', NULL, '2', 'relationship_found', 'Posible familiar encontrado', 'Hemos encontrado un usuario que podria estar relacionado contigo. Carlos Rodriguez Kovacevic tambien tiene ascendencia de la region de Dalmacia. ¿Te gustaria enviarle una solicitud de conexion?', NULL, '1', 'pending', NULL, NULL, NULL, '2025-12-11 10:19:16');
INSERT INTO `messages` (`id`, `sender_id`, `recipient_id`, `type`, `subject`, `body`, `related_person_id`, `action_required`, `action_status`, `action_taken_at`, `read_at`, `deleted_at`, `created_at`) VALUES ('4', '1', '2', 'general', 'Evento de la comunidad', 'Estimado Ivan, te invitamos al proximo evento de la comunidad que se celebrara el proximo mes. Sera una gran oportunidad para conocer a otros miembros de la comunidad.', NULL, '0', NULL, NULL, NULL, NULL, '2025-12-11 10:19:16');
